$(document).ready(function(){$("#responsiveTabs").responsiveTabs({startCollapsed:"tabs"}),$(".minus").click(function(){var n=$(this).parent().find("input"),a=parseInt(n.val())-1;return a=a<0?0:a,n.val(a),n.change(),!1}),$(".plus").click(function(){var n=$(this).parent().find("input");return n.val(parseInt(n.val())+1),n.change(),!1})});